// Get glyph by Unicode codepoint (linear search)
static inline const GlyphData *get_glyph(unsigned int codepoint) {
    for (int i = 0; glyph_lookup_table[i].glyph; i++) {
        if (glyph_lookup_table[i].codepoint == codepoint) {
            return glyph_lookup_table[i].glyph;
        }
    }
    return NULL;
}

